bioghist.p:
Een Directie FEZ heeft de navolgende taken:


het geven van een oordeel over beleids- en wetsvoorstellen die op het betreffende departement tot stand komen en geldelijke gevolgen kunnen hebben;

het opstellen van de ontwerp-begroting en meerjarenramingen alsmede van aanvullende begrotingsontwerpen (suppletore begrotingen), zowel voor uitgaven als ontvangsten;

het uitoefenen van toezicht op de uitvoering van de begroting, waarbij het met name gaat om het toezicht op de rechtmatige en doelmatige besteding van de toegestane begrotingsbedragen;

het inrichten en bijhouden van de financiële administraties van het departement;

het opstellen van de jaarlijkse financiële verantwoording;

het betaalbaarstellen en het innen van vorderingen;

het toezichthouden op de naleving van comptabele regelgeving.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
